import React, { Component } from 'react';
import "./contact.css"

export default  class Contact extends Component {
  render() {
    return (
        <div id="contact-wrapper">
            <div id="contact-container">
                <h1>Kontakt mig</h1>
                <p>Hvis du er interesseret i at høre mere om, hvad et træningsforløb kan gøre for dig og dit liv, 
                    må du meget gerne udfylde denne formular. Jeg vil vende tilbage til dig hurtigst muligt – typisk inden for 48 timer.

                </p>
                <ul>
                    <li><strong>E-mail :</strong> <a href = "mailto:mathiesenmarcus@gmail.com?">mathiesenmarcus@gmail.com</a></li>
                    <li><strong>Phone:</strong> +45 61 40 91 87</li>
                    <li><strong>Address:</strong> Bragesgade 2, 4. tv, 2200 Copenhagen, Denmark</li>
                </ul>
            </div>
        </div>
    );
  }
}
